import React from 'react';

/*
NEEDS:

dish name
dish rating
dish description
date
(photo)
(user and user info)
(upvotes and downvotes)
*/


class Review extends React.Component {
    render() {
        return (
            <div>
                <h1>id: {this.props.review.review_id}</h1>
                <h1>dishname: {this.props.review.dish_name}</h1>
                <h1>dishrating: {this.props.review.dish_rating}</h1>
                <h1>dishbody: {this.props.review.dish_description}</h1>
            </div>
        );
    }
}

export default Review;
